import React, { Component } from 'react';
import './Todo.css';
//import logo from './images/delete.png';

class Todo extends Component {

  constructor(props) {
    super(props);
    this.state = {
      id: this.props.id,
      text: this.props.text,
      user: this.props.user,
      completed: this.props.completed,
      checkEvent: this.props.checkEvent,
      deleteEvent: this.props.deleteEvent,
    }
  }

  render() {
    return (
      <div
        className="list-label"
        id={this.props.id} >
        <input className="check-box"
          type="checkbox"
          checked={this.props.completed}
          onClick={this.props.checkEvent}>
        </input>
        <li className={this.props.completed + "-todo-item"}>
          {this.props.text}
        </li>
        <input
          type="image"
          className="delete-img"

          alt='aria-label'
          onClick={this.props.deleteEvent}>

        </input>
      </div >
    );
  }
}

export default Todo;
